import React from "react";
import "./style.css";
export default class Logs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      continents: [],
    };
  }
  componentDidMount() {
    fetch("http://localhost:4000/api/logs")
      .then((response) => {
        return response.json();
      })
      .then((json) =>
        this.setState({
          data: json.logs,
        })
      );
    console.log(this.state.data);
  }
  render() {
    return (
      <div>
        <thead>
          <tr>
            <th>Name</th>
            <th>Composer</th>
            <th>Minutes</th>
          </tr>
        </thead>
        <tbody>
          {this.state.data}
          {/* {this.state.data.map((each) => (
            <tr key={each.id}>
              <td>{each.title}</td>
            </tr>
          ))} */}
        </tbody>
      </div>
    );
  }
}
